  input: '"TEXT","F3XN","C00143743","The Committee has received the Commission''s
    letter dated January 29, 2003 and herewith amends its report as follows: In reference
    to the Commission''s first item: This contribution is a transfer of excess funds
    by the principal campaign committee of a Congressional candidate as allowed by
    CFR 113.2(c). In reference to the Commission''s second item: The transfers made
    to the non-federal accounts were made for refunds/reimbursements received by the
    Committee and shown on Schedule A Line 15, as referenced in the original report.
    In addition to the vendors listed (Renaissance Austin Hotel and Crossroads Media),
    the refunds/reimbursements were made by former employees of the Committee for
    COBRA health insurance payments by the Committee to Humana, by the Committee members
    for payments by the Committee to Whitfield & Associates for printing, and by the
    Texas Federation of Republican Women for sub-lease rent/parking, postage, and
    telephone expenses. The payments to the vendors (Humana, Southwest Educational
    Development Lab, Highland Resources, Whitfield & Assoc., and Logix Communications)
    are reported within this report. Reimbursement was made either prior to the expenditure
    or within a commercially reasonable time.  In reference to the Commission''s third
    item: The Committee has amended its report to add the specific reference, however
    due to the limitations of electronic filing the Committee was forced to put the
    reference in the same space as the name of the account on Schedule H3. In reference
    to the Commission''s fourth item: The Committee is unable to find the item referenced
    and believes that all items have been correctly reported on Line 11(a)(ii) and
    Line 11(a)(i) of Schedule A."'
